import React, {useState} from "react";
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import {useNavigate} from "react-router-dom";
import Header from "../include/nav";

function Create() {

    const [image, setImage] = useState(null);
    const [brand, setBrand] = useState("");
    const [price, setPrice] = useState("");
    const [fuel, setFuel] = useState("");
    const [model, setModel] = useState("");
    const [gearbox, setGearbox] = useState("");
    const [availability, setAvailability] = useState(false);

    const navigate = useNavigate(); //navigation

    const carPost = async (event) => {
        event.preventDefault();


    }

    return (
        <div>
            <Header/>
            <div className={"container"}>
                <Form onSubmit={carPost} encType="multipart/form-data" className={"w-50 text-left"}>
                    <Form.Group className="mb-3" controlId="formBasicBrand">
                        <Form.Label>Brand</Form.Label>
                        <Form.Control type="text" placeholder="Enter Brand Name" value={brand}
                                      onChange={(e) => setBrand(e.target.value)}/>
                    </Form.Group>
                    <Form.Group className="mb-3" controlId="formBasicModel">
                        <Form.Label>Model</Form.Label>
                        <Form.Control type="text" placeholder="Enter Model" value={model}
                                      onChange={(e) => setModel(e.target.value)}/>
                    </Form.Group>

                    <Form.Group className="mb-3" controlId="formBasicPrice">
                        <Form.Label>Price Per day</Form.Label>
                        <Form.Control type="integer" placeholder="Enter Price" value={price}
                                      onChange={(e) => setPrice(e.target.value)}/>
                    </Form.Group>
                    <Form.Group className="mb-3" controlId="formBasicFuel">
                        <Form.Label>Fuel</Form.Label>
                        <Form.Control type="text" placeholder="Enter Fuel Type" value={fuel}
                                      onChange={(e) => setFuel(e.target.value)}/>
                    </Form.Group>
                    <Form.Group className="mb-3" controlId="formBasicGearbox">
                        <Form.Label>Gearbox</Form.Label>
                        <Form.Control type="text" placeholder="Enter GearBox type" value={gearbox}
                                      onChange={(e) => setGearbox(e.target.value)}/>
                    </Form.Group>
                    <Form.Group className="mb-3" controlId="formBasicModel">
                        <Form.Label>Availability</Form.Label>
                        <Form.Check type="checkbox"  checked={availability} onChange={(e) => setAvailability(e.target.checked)}/>
                    </Form.Group>
                    <Form.Group className="mb-3" controlId="formFile">
                        <Form.Label>Upload Image</Form.Label>
                        <Form.Control type="file" onChange={(e) => setImage(e.target.files[0])}/>
                    </Form.Group>

                    <Button type={"submit"} variant="primary">
                        Submit
                    </Button>
                </Form>
            </div>
        </div>
    );
}

export default Create
